CommonData.BannerCustomCSS:
/*footer button */
#ot-sdk-btn.ot-sdk-show-settings {
    color: #03c;
    border: 1px solid #03c;
    background: #FFF;
   }
   #ot-sdk-btn.ot-sdk-show-settings:hover {
    color: #FFF;
    border: 1px solid #03c;
    background: #03c;
   }
   /* H1 header */
   #onetrust-consent-sdk #onetrust-policy-title {
   font-size: 20px;
   line-height: 24px;
   }
   /* H2 header */
   #onetrust-banner-sdk.ot-iab-2 .ot-dpd-title {
   font-size: 12px;
   line-height: 16px;
   }
   /* p text */
   #onetrust-consent-sdk .ot-dpd-desc {
   font-size: 12px;
   line-height: 16px;
   }
   /* yellow border and parent font */
   #onetrust-consent-sdk #onetrust-banner-sdk {
   border-top: 8px solid #F5DF2D;
   font-family: "Helvetica Neue",Helvetica,"Nimbus Sans",Arial,sans-serif;
   }

/* cookie policy link in banner */
 #onetrust-banner-sdk #onetrust-policy-text a {
font-weight: normal;
}
#onetrust-banner-sdk #onetrust-policy-text a:hover {
text-decoration: underline;
}  

   #onetrust-banner-sdk.ot-iab-2 #onetrust-policy-text { 
   border-right: none;
   font-size: 12px;
   line-height: 16px;
   font-weight: normal;
   }

   /*  buttons */ 
   #onetrust-banner-sdk.ot-iab-2 #onetrust-button-group button {
   letter-spacing: .06em;
   font-size: .875em;
   font-weight: normal;
   width: 250px;
   height: 44px;
   margin-top: 10px;
   }
   /* vendor link */
   #onetrust-consent-sdk #onetrust-banner-sdk .ot-link-btn {
   font-weight: normal;
   font-size: 12px;
   line-height: 16px;
   }
   #onetrust-consent-sdk #onetrust-banner-sdk .ot-link-btn:hover {
   text-decoration: underline;
   opacity: 1;
   }
   #onetrust-consent-sdk #onetrust-pc-sdk .ot-pc-footer .ot-btn-container button {
   letter-spacing: .06em;
   font-size: .875em;
   font-weight: normal;
   }

   /* more options button*/

    #onetrust-consent-sdk #onetrust-pc-btn-handler {
    border: 2px solid #000000;
    }
    #onetrust-consent-sdk #onetrust-pc-btn-handler:hover {
    background-color: #000000;
    color: #FFFFFF;
    opacity: 1;
    }

   /* override spaceing of button groups for ipad */ 
   #onetrust-banner-sdk.ot-iab-2 #onetrust-button-group-parent {
   left: auto;
   }

   /* media specifici css */

   @media (min-width: 550px) {
   /* text content */
   #onetrust-banner-sdk .ot-sdk-ten.ot-sdk-columns, #onetrust-pc-sdk .ot-sdk-ten.ot-sdk-columns, #ot-sdk-cookie-policy .ot-sdk-ten.ot-sdk-columns {
       width: 70%;
   }
   /* button group parent */
   #onetrust-banner-sdk .ot-sdk-two.ot-sdk-columns, #onetrust-pc-sdk .ot-sdk-two.ot-sdk-columns, #ot-sdk-cookie-policy .ot-sdk-two.ot-sdk-columns {
       width: 30%;
   }
   /* button group margin top */ 
   #onetrust-banner-sdk #onetrust-button-group {
       margin-top: 10px;
   }
   }

   @media only screen and (max-width: 425px) {
   #onetrust-banner-sdk.ot-iab-2 #onetrust-button-group button {
       width: 100%;
       height: auto;
   }
   }

CommonData.PCCustomCSS:
/* Default font size for scaling keep for reference but too inconsistent for now
#onetrust-banner-sdk, #onetrust-pc-sdk, #ot-sdk-cookie-policy, #ot-sync-ntfy {
font-size: 1rem;
}
*/

#onetrust-pc-sdk #ot-pc-content {
    font-family: "Helvetica Neue",Helvetica,"Nimbus Sans",Arial,sans-serif;
  }
  /* cookie list details font size. font-sizes are messing up with rem
  #onetrust-pc-sdk .ot-host-opt {
  font-size: 0.75rem;
  }
  */

  /* Border for WinHCM */
  #onetrust-pc-sdk {
  border: 1px solid transparent;
  }

  #onetrust-pc-sdk .ot-accordion-layout.ot-cat-item:first-of-type {
      border-top: 1px solid #f2f2f2; 
      }
      #onetrust-pc-sdk .ot-accordion-layout.ot-cat-item {
      border: 1px solid #f2f2f2; 
      margin: 2px;
      }
      #onetrust-pc-sdk .ot-cat-grp .ot-always-active {
      color: #000000;
      font-weight: normal;
      }
      #onetrust-pc-sdk .ot-acc-grpcntr .ot-acc-grpdesc {
      margin-bottom: 15px;
      }

      #onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob {
      background-color: #009933;
      border: 1px solid #009933; 
      }
      #onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob:before {
      background-color: #ffffff;
      border-color: #ffffff;
      }
      #onetrust-pc-sdk .ot-switch-nob {
      background-color: #333; 
      border: 1px solid #333; 
      }
      #onetrust-pc-sdk .ot-switch-nob:before {
      background-color: #FFFFFF; 
      }
  /*Feels anti-ADA, so commenting out but preserving in case we want it still 
      #onetrust-pc-sdk .ot-cat-item>button:focus, #onetrust-pc-sdk .ot-acc-cntr>button:focus, #onetrust-pc-sdk li>button:focus, #onetrust-pc-sdk {
          outline: none;
      }
     */

      #onetrust-pc-sdk #accept-recommended-btn-handler {
      letter-spacing: .06em;
      font-size: .875em;
      font-weight: normal;
      }

      /*Make focus more visible on main buttons */
     #onetrust-pc-sdk #accept-recommended-btn-handler:focus, #onetrust-pc-sdk button.save-preference-btn-handler:focus, #onetrust-pc-sdk #filter-btn-handler:focus {
      outline-offset: 2px;
     }

      #onetrust-pc-sdk .ot-obj-leg-btn-handler span {
      letter-spacing: .06em;
      font-size: .875em;
      font-weight: normal;
      }

      #onetrust-pc-sdk .category-vendors-list-handler+a::after {
      color: #0033BB;
      }

#onetrust-consent-sdk #onetrust-pc-sdk .privacy-notice-link {
   font-weight: normal;
}
#onetrust-consent-sdk #onetrust-pc-sdk .privacy-notice-link:hover {
  text-decoration: underline;
}

      /* plus-minus toggle */
      #onetrust-pc-sdk .ot-plus-minus span {
      background: #000000;
      }

    /* WinHCM media specific */
  @media (-ms-high-contrast: active), (forced-colors: active) {
      #onetrust-pc-sdk .ot-switch-nob:before {
         background-color: ButtonText;
      }
     #onetrust-pc-sdk .ot-plus-minus span {
      background: ButtonText;
     }
    #onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob:before {
        background-color: ButtonText;
        border-color: ButtonText;
    }
  }
